script: |
  super -f text -I q5859.spq | sort > q5859.out

inputs:
  - name: q5859.spq
    data: |
      SELECT + ( 71 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE + col0 * - col0 NOT BETWEEN + - col0 * - - col0 + col0 AND 96;
  - name: tab2

outputs:
  - name: q5859.out
    data: |
      71
      71
      71
